버튼이 빙빙 돌기만 해서 업뎃도 못하고 주문도 못하고…

리뷰 중에 자기는 오류 난 적 없다 로켓 배송 늦은 적 없다고 하는 사람 참 어이없네요;;;
자기가 그런 적 없으면 다른 사람도 그런 적 없는거라는 건가요? 악의적 고의적을 어디다가 가져다 붙이는지...
로켓 배송이라면서 배송 늦게 받은 적이 한 두번이 아니고 심지어 물건 파선 되서 온 적은 셀 수도 없을 정도예요.
님이 운이 좋았을 뿐이지 이런 피해를 겪는 사람이 상당수라는 겁니다.
그럼 쿠팡측에서 게선을 해야하는게 맞죠.
다른 사이트 알바 아니냐고 하는데 님들은 쿠팡 알바같아요;
몇몇 말도 안 되는 불만을 토로하는 리뷰 빼고는 다 말 되는 리뷴데 무슨;;;
지금도 배송 조회하려고 마이쿠팡 들어가려는데 안 들어가져서 삭제-설치를 반복하고 있습니다.
앱이라도 잘 돌아가게 만드셔야하지 않겠어요?

이렇게 쓰기 불편한 앱은 처음보네;;; 
처음 실행시 카테고리 분류없이 보여주는 것도 매우 웃기고 도대체 누구 편하라고 만든 인터페이스냐고; 반응도 느려터졌고 다른 소셜 커머스 앱이랑 비교되네
그리고 앱상에서 비번찾기 못하는걸 왜 아이디와 이름 적으라고 해논거야ㅋㅋ똥새 훈련시키냐ㅋㅋㅋ

