로켓배송에 제한 금액 붙냐고 거지같대ㅋㅋㅋㅋ 진짜 거지가 누구일까? ㅋㅋㅋㅋ 식품, 화장품, 가전 등등에서 하나씩 사야하는 경우 다른 종류 각각 사도 한꺼번에 배송되어 설사 배송료가 붙는다 해도 한번만 내는게 얼마나 큰 건데ㅋㅋㅋ 세개 한번씩 배송료만 해도 9000원 정도고 배송료 안붙이려면 최소한 각각 삼만원 이상 사야하는데 필요한거 장바구니에 넣어서 어느정도 가격 맞춰지면 한꺼번에 사면 되는걸 백원짜리 시켜도 공짜배송 하라는건 노양심이지 않아요? 그 와중에 친절한 쿠팡맨 찾고 있어 ㅋㅋㅋ고객 서비스 한다고 초반 이것저것 서비스 하다가 수지타산 안맞아 공지없이 정규직 채용 안하고 인원수도 줄어들어 생글거릴 시간이 없어졌어요. 쿠팡맨이 피해입은거죠. 
 이것때문에 말 많았는데뉴스 안보나보다 ㅠㅠ 그리고 배송 늦게됐다는 분은 택배가 cj인거 보면 개인미니샵같은곳에서 산거 같은데 그건 미니샵 사장에게 따져야지 그걸 왜 쿠팡에 따져요?;;;
그리고 어플에 자잘한 버그 많아요. 장바구니 안보이는건 간혈적으로 몇달째 지속되고 있는데 자기는 문제없다고 욕한분.... ㅋㅋㅋㅋㅋㅋ 자기만 총명하고 다른사람들은 다 바보라 어플도 제대로 이용 못하는 건가? 단순한 쇼핑앱을? ㅋㅋㅋㅋㅋㅋ
